import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Automation Logic ---

    // 1. Open the mobile menu modal by clicking the "All" button
    // Using a combination of class and text content for a specific selector
    const menuButton = page.locator('div.nav-menu:has-text("All")');
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // 2. Wait for the modal to become visible and verify its state
    const modal = page.locator('#mobileMenuOverlay');
    await modal.waitFor({ state: 'visible', timeout: 5000 });
    const isVisibleBefore = await modal.isVisible();

    // 3. Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // 4. Press the 'Escape' key to close the modal
    await page.keyboard.press('Escape');

    // 5. Wait for the modal to be hidden and verify its state
    await modal.waitFor({ state: 'hidden', timeout: 5000 });
    const isVisibleAfter = await modal.isVisible();

    // 6. Take a final screenshot to confirm the modal is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    return {
      success: true,
      action: "Successfully opened a modal, closed it with the Escape key, and verified its visibility state.",
      extractedData: {
        modalVisibleBeforeEscape: isVisibleBefore,
        modalVisibleAfterEscape: isVisibleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
